import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { useNavigate } from 'react-router';
import{increment,descrement} from './store'
export default function Counter() {
  const navigt=useNavigate()
    const cntr=useSelector((data)=>data.counter.val);
    const dispatch=useDispatch()
  return (
    <div className='d-flex justify-content-center mt-4'>
        <button onClick={()=>dispatch(increment(1))}>dark</button>
        <span>{cntr}</span>
        <button onClick={()=>dispatch(descrement(1))}>light</button>
        <div><button onClick={()=>navigt('/')}>logout</button></div>
    </div>
  )
}
